      try {
        const getUser = async()=>{
          const data = await fetch('http://127.0.0.1:8000/Blog/GetAllUsersAdmin' , {
            method:"GET",
            headers:{
              "Content-type":"application/json"
            }
          })
          const res = await data.json()
          console.log(res)

        }
        getUser()        
      } catch (error) {
        console.log(error.message)
      }

    },[])
  return (
    <div>
      Users Blog
    </div>
  )
}
